// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

contract RentTrust {
    address public landlord;
    address public tenant;

    // ✅ New fields for full rental agreement data
    string public propertyAddress;
    uint public rentAmount;
    uint public securityDeposit;
    uint public startDate;
    uint public endDate;
    string public rules;

    uint public dueDate;
    bool public isActive;

    event RentPaid(address indexed tenant, uint amount, uint date);
    event RentalAgreementCreated(
        address landlord,
        address tenant,
        string propertyAddress,
        uint rentAmount,
        uint securityDeposit,
        uint startDate,
        uint endDate,
        string rules
    );
    event SecurityDepositPaid(address tenant, uint amount, uint date);

    modifier onlyTenant() {
        require(msg.sender == tenant, "Only the tenant can call this");
        _;
    }

    modifier onlyLandlord() {
        require(msg.sender == landlord, "Only the landlord can call this");
        _;
    }

    constructor(
        address _tenant,
        string memory _propertyAddress,
        uint _rentAmount,
        uint _securityDeposit,
        uint _startDate,
        uint _endDate,
        uint _dueDate,
        string memory _rules
    ) {
        landlord = msg.sender;
        tenant = _tenant;

        // ✅ Initialize new fields
        propertyAddress = _propertyAddress;
        rentAmount = _rentAmount;
        securityDeposit = _securityDeposit;
        startDate = _startDate;
        endDate = _endDate;
        dueDate = _dueDate;
        rules = _rules;

        isActive = true;

        emit RentalAgreementCreated(
            landlord,
            tenant,
            _propertyAddress,
            _rentAmount,
            _securityDeposit,
            _startDate,
            _endDate,
            _rules
        );
    }

    // ✅ Pay rent function (unchanged but includes extra data now)
    function payRent() external payable onlyTenant {
        require(isActive, "Rental agreement is not active");
        require(msg.value == rentAmount, "Incorrect rent amount");
        require(block.timestamp <= dueDate, "Payment is overdue");

        payable(landlord).transfer(msg.value);
        emit RentPaid(msg.sender, msg.value, block.timestamp);
    }

    // ✅ New: Tenant pays security deposit (if not handled in constructor)
    function paySecurityDeposit() external payable onlyTenant {
        require(msg.value == securityDeposit, "Incorrect deposit amount");
        payable(landlord).transfer(msg.value);
        emit SecurityDepositPaid(msg.sender, msg.value, block.timestamp);
    }

    function terminateAgreement() external onlyLandlord {
        isActive = false;
    }
}

